import Container from 'react-bootstrap/Container'
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import cardWidget from './cardWidget';
import logo from '../../img/logotipo.png'; 
import './navbar.css';


const Barranav =()=> {
  return (
    <>
      {['md'].map((expand) => (
        <Navbar key={expand}  expand={expand} className="mb-3 navegacion">
          <Container>

            <Navbar.Brand href="#" className='barra-der'><img className='logo-nav' src={logo}></img></Navbar.Brand>
                  <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
                  <Navbar.Offcanvas id={`navegacion-${expand}`} aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`} placement="end">
                          <Offcanvas.Header closeButton>
                                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}></Offcanvas.Title>
                          </Offcanvas.Header>

                          <Offcanvas.Body>
                                  <Nav className="barra-central">
                                      <Nav.Link href="#rines">Rines</Nav.Link>
                                      <Nav.Link href="#llantas">Llantas</Nav.Link>
                                      <Nav.Link href="#accesorios">Accesorios</Nav.Link>
                                  </Nav>

                                <Nav className="justify-content-end flex-grow-1 pe-3 barra-iz">

                                              <cardWidget></cardWidget>
                                              <NavDropdown title="Mi cuenta" id={`offcanvasNavbarDropdown-expand-${expand}`}>
                                                          <NavDropdown.Item href="#action4">Mis pedidos</NavDropdown.Item>
                                                  <NavDropdown.Divider />
                                                          <NavDropdown.Item href="#action5">Iniciar Sesi√≥n</NavDropdown.Item>
                                              </NavDropdown>
                                </Nav>
                          </Offcanvas.Body>
              </Navbar.Offcanvas>

          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default Barranav;
